import React from 'react';

const Hero = () => {
  return (
    <div className="bg-gray-100 py-20">
      <div className="max-w-4xl mx-auto text-center">
        <h1 className="text-5xl font-bold mb-6">Dr. Yoshiyuki Kitaguchi</h1>
        <h2 className="text-3xl font-semibold mb-4">Oculoplastic Surgeon & AI Researcher</h2>
        <p className="text-xl mb-8">
          Bridging the gap between surgical precision and artificial intelligence to revolutionize patient care.
        </p>
        <div className="mb-8">
          <img 
            src="/images/profile.jpg" 
            alt="Dr. Yoshiyuki Kitaguchi" 
            className="rounded-full w-48 h-48 mx-auto object-cover shadow-lg"
          />
        </div>
        <p className="text-2xl font-bold italic">
          "Driving Innovation Through Free Thinking"
        </p>
      </div>
    </div>
  );
};

export default Hero;
